import React from "react";
import './Header.css';
import {Link} from 'react-router-dom';
import {BrowserRouter} from 'react-router-dom';

function Header() {
    return (

        <header>
            <div className="logo">
                <h1><Link to="/">Prueba de Aptitud Academica</Link></h1>
            </div>

            <ul>
                <li><Link to="/login"><i class="fas fa-user-graduate"></i>Iniciar Sesion</Link></li>
                <li><Link to="/register"><i class="fas fa-user"></i>Registrarse</Link></li>
            </ul>
        </header>

    )
}

export default Header;
